import React from 'react'
import { Link } from 'react-router-dom';


const HomePage = () => {
    const renderDiv = (image) => {
        let item = [];
        for (let i = 0; i < 4; i++) {
          item.push(
            <div 
              key={ i }
            >            
                <img
                    src={image}
                />
            </div> 
          );
        }
        return item;
      }

      return (
        <div >

            { renderDiv() }
        </div>
      )
}

export default HomePage
